import React from 'react';
import {sushi} from './Data'
import './App.css';
import {Route, Routes, BrowserRouter} from "react-router-dom";
import Header from "./Components/Header/Header";
import Rolls from "./Components/Rolls/Rolls";
import Index from "./Components/Index/Index";
import Footer from "./Components/Footer/Footer";
import Sushi from "./Components/Sushi/Sushi";
import Product from "./Components/Products/Product";

type categoryType = {
    category: string,
    link: string
}
let categories: categoryType[] = [
    {
        category: 'СЕТЫ',
        link:'sets'
    },
    {
        category: 'РОЛЛЫ',
        link: "rolls"
    },
    {
        category: 'СУШИ',
        link: 'sushi'
    },
    {
        category: 'ПИЦЦА',
        link: 'pizza'
    },
    {
        category: 'САЛАТЫ',
        link: 'salads'
    },
    {
        category: 'БУРГЕРЫ',
        link: 'burgers'
    },
    {
        category: 'ВОКИ',
        link: 'woks'
    },
    {
        category: 'СУПЫ',
        link: 'soups'
    },
    {
        category: 'ГАРНИРЫ',
        link: 'garnish'
    },
    {
        category: 'НАПИТКИ',
        link: 'drinks'
    },
    {
        category: 'ПОКЕ',
        link: 'pokes'
    }]


function App() {
    return (
        <div className="App">
            <div>
                <Header categories={categories}/>
                <Routes>
                    <Route path="/" element={<Index/>}
                    />
                    <Route path="/rolls/*" element={<Rolls />}
                    />
                    <Route path="/sushi/" element={<Product productsType={'суши'} products={sushi} />}/>

                    <Route path="/pizza/" element={<Product productsType={'пицца'} products={sushi} />}/>
                    <Route path="/sushi/" element={<Product productsType={'воки'} products={sushi} />}/>
                    <Route path="/sushi/" element={<Product productsType={'сеты'} products={sushi} />}/>
                </Routes>
            </div>
            <Footer/>
        </div>
    );
}

export default App;
